import React from "react";
import "./Byline.scss";

interface BylineProps {
    logo: string;
    header: string;
    image: string;
    creditName?: string;
    children: React.ReactNode;
}

const Byline = (BylineProps: BylineProps) => {
    const { logo, header, image, creditName, children } = BylineProps;
    return (
        <div className="Byline">
            <img
                className="Logo"
                src={require(`../../assets/${logo}`)}
                alt=""
            />
            <h2>{header}</h2>
            <img src={require(`../../assets/${image}`)} alt="" />
            <p className="Credit">{creditName}</p>
            <p>{children}</p>
        </div>
    );
};

export default Byline;
